import MainComponent from './MainComponent';
import {Routes,Route} from 'react-router-dom'
const App = () => {
  return (
    <div>
    <Routes>
     <Route  path="/" element={ <MainComponent/>}/>
     <Route path />
      </Routes>
    </div>
  )
}

export default App
